VALUES ('3660014118343', 'Risotto aux Fruits de Mer', 'Eau, riz 13,1 %, queues de _crevettes_ 11,9 % (_crevettes_, sel, conservateurs : acide citrique, _disulfites_ de sodium E331- E332) _crème_ liquide (_crème_, stabilisant : carraghénanes), _encornets_ géants 9,5 % (_encornets_ géants, eau, sel, stabilisants diphosphates - triphosphates - polyphosphates, acidifiants : acide citrique - citrates de sodium - citrates de potassium - carbonates de potassium), _moules_ du Pacifique décortiquées 6,4%, julienne de légumes (carotte, _céleri_, courgette, échalote, huile de colza, arôme naturel (dont _mollusques_), persil, fécule modifiée, tomates mi- séchées,  jus de citron, antioxydant _disulfites_ de potassium), gélatine alimentaire de bœuf contient _sulfites_), Cognac, poudre au _beurre_ (_beurre_, maltodextrines, protéines de _lait_ émulsifiant : E471), _fromage_ fondu (_fromage_ en poudre, sel de fonte :phosphates de sodium, sel, extrait de vin blanc (contient _sulfites_), arôme naturel, épaississant : gomme xanthane, ail.', 'https://static.openfoodfacts.org/images/products/366/001/411/8343/front_fr.13.400.jpg', '6.2', '0.2', '7.4', '0.5', '', '6.4', '1', '0.393700787401575', '', '1');

